import React from "react";
import "./App.css";
import { PowerBIEmbed } from 'powerbi-client-react';
import { models } from 'powerbi-client';

//How to: https://www.google.com/search?q=how+to+embed+a+dashboard+from+Power+BI+in+react&oq=how+to+embed+a+dashboard+from+Power+BI+in+react&aqs=chrome..69i57j33i22i29i30.12619j0j7&sourceid=chrome&ie=UTF-8#kpvalbx=_VMUvYemdEO3I_QaMj5noBA87
//Power BI Install: https://www.npmjs.com/package/powerbi-client-react
//Power BI Rest APIs: https://docs.microsoft.com/en-us/rest/api/power-bi/reports/get-report-in-group#code-try-0

//Report ID and Group ID are located in URL of Power BI. Need a way to automatically find report ID

function Header(props) {
  return (
    <header>
      <h1>{props.name}</h1>
    </header>
  );
}

function Main() {
  return (
    <div>
		<div>
			<h2> Power BI Dashboard</h2>
      		<PowerBIEmbed
	    		embedConfig = {{
		  			type: 'dashboard',   // Supported types: report, dashboard, tile, visual and qna
		  			id: '4d696ece-5cb7-4250-9be4-ce160931b242',
		  			embedUrl: "https://app.powerbi.com/reportEmbed?reportId=4d696ece-5cb7-4250-9be4-ce160931b242&groupId=e86aa8ce-18f2-4fba-bb98-4bb45fdab66e&w=2&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLVVTLU5PUlRILUNFTlRSQUwtRi1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJtb2Rlcm5FbWJlZCI6dHJ1ZSwiY2VydGlmaWVkVGVsZW1ldHJ5RW1iZWQiOnRydWUsInVzYWdlTWV0cmljc1ZOZXh0Ijp0cnVlfX0%3d",

					//Power BI dashboard -> inspector -> console -> "copy(powerBIAccessToken)" -> enter
		  			accessToken: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyIsImtpZCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyJ9..WaUE6t2bYV4oEn9HMeIGWb4GoeUnEGCrj3WEAuz_otk1uOAaoLpI9Zic8LtHPMab-6oN7RIvv05qIAj1w6-lJyHHK2WP87oNspFX-fyLCivCkmZh-u8MH9d4L_Y9t9xddwqPlNH8k6ygkoas5ctwdhQR62IVn5Nc7txjclArtn1Y92NQEeTCyH-orvd9ARfuJkER9gIfReg7BvkpJ7DAfg7ZzF1erf8kibMB3DdehmA9bupNAH6-39QelCFpf9N3S2QwSItNecltd-DuA5TXKzCrYBMTbkL84ndg3GiF38lrCQdHhhv2U8qwTIid1wE9ac5EeHeuDCjPy2VbjL7A2Q',
		  			tokenType: models.TokenType.Aad, //azure access directory
		  			settings: {
						panes: {
							filters: {
								expanded: false,
					  			visible: false
							}
						},
					}
				}}

				eventHandlers = { 
					new Map([
						['loaded', function () {console.log('Report loaded');}],
						['rendered', function () {console.log('Report rendered');}],
						['error', function (event) {console.log(event.detail);}]
					])
				}

				cssClassName = { "powerBIContainer" }

				getEmbeddedComponent = { (embeddedReport) => {
					window.report = embeddedReport;
				}}
			/>
		</div>

			<h2>Power BI visual</h2>
			<PowerBIEmbed
	    		embedConfig = {{
		  			type: '',   // Supported types: report, dashboard, tile, visual and qna
		  			id: '4f71182d-038a-4974-ad4c-98240217483e',
		  			embedUrl: "https://app.powerbi.com/reportEmbed?reportId=4f71182d-038a-4974-ad4c-98240217483e&groupId=e86aa8ce-18f2-4fba-bb98-4bb45fdab66e&w=2&config=eyJjbHVzdGVyVXJsIjoiaHR0cHM6Ly9XQUJJLVVTLU5PUlRILUNFTlRSQUwtRi1QUklNQVJZLXJlZGlyZWN0LmFuYWx5c2lzLndpbmRvd3MubmV0IiwiZW1iZWRGZWF0dXJlcyI6eyJtb2Rlcm5FbWJlZCI6dHJ1ZSwiY2VydGlmaWVkVGVsZW1ldHJ5RW1iZWQiOnRydWUsInVzYWdlTWV0cmljc1ZOZXh0Ijp0cnVlfX0%3d",

					//Power BI dashboard -> inspector -> console -> "copy(powerBIAccessToken)" -> enter
		  			accessToken: 'eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsIng1dCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyIsImtpZCI6Im5PbzNaRHJPRFhFSzFqS1doWHNsSFJfS1hFZyJ9..WaUE6t2bYV4oEn9HMeIGWb4GoeUnEGCrj3WEAuz_otk1uOAaoLpI9Zic8LtHPMab-6oN7RIvv05qIAj1w6-lJyHHK2WP87oNspFX-fyLCivCkmZh-u8MH9d4L_Y9t9xddwqPlNH8k6ygkoas5ctwdhQR62IVn5Nc7txjclArtn1Y92NQEeTCyH-orvd9ARfuJkER9gIfReg7BvkpJ7DAfg7ZzF1erf8kibMB3DdehmA9bupNAH6-39QelCFpf9N3S2QwSItNecltd-DuA5TXKzCrYBMTbkL84ndg3GiF38lrCQdHhhv2U8qwTIid1wE9ac5EeHeuDCjPy2VbjL7A2Q',
		  			tokenType: models.TokenType.Aad, //azure access directory
		  			settings: {
						panes: {
							filters: {
								expanded: false,
					  			visible: false
							}
						},
					}
				}}

				eventHandlers = { 
					new Map([
						['loaded', function () {console.log('Report loaded');}],
						['rendered', function () {console.log('Report rendered');}],
						['error', function (event) {console.log(event.detail);}]
					])
				}

				cssClassName = { "powerBIContainer" }

				getEmbeddedComponent = { (embeddedReport) => {
					window.report = embeddedReport;
				}}
			/>

		<div>
			<h2>Looker Dashboard</h2>



		</div>
	</div>
  );
}

function Footer() {
  return (
    <footer>






    </footer>
  );
}



function App() {
  return (
    <div className="App">
      <Header name="Next Gen O360"/>
      <Main/>
      <Footer/>
    </div>
  );
}

export default App;
